import React, { useEffect } from "react";
import { useNavigate } from "react-router-dom";

function Home() {
  let navigate = useNavigate();
  let login_validator = () => {
    if (localStorage.getItem("username") !== "foo") {
      navigate("/Login");
    } else if (localStorage.getItem("paswword") !== "bar") {
      navigate("/Login");
    }
  };

  useEffect(() => {
    login_validator();
  }, []);

  return <div>This is home</div>;
}

export default Home;
